import React, { useEffect, useState } from "react";



const Suscriber = () => {

    const [data, setData] = useState([]);
    const [users, setUsers] = useState([{}])

    useEffect(() => {
        fetch('data/users.json').then((res) => res.json()).then((data) => {
            setUsers(data)
        })

    }, [])

    const getData = () => {
        fetch('./data/subscriptions.json'
            , {
                headers: {
                    'Content-Type': 'application/json',
                    'Accept': 'application/json'
                }
            }
        )
            .then(function (response) {
                console.log(response)
                return response.json();
            })
            .then(function (myJson) {
                console.log(myJson);
                setData(myJson)
            });
    }

    useEffect(() => {
        getData()
    }, [])



    return (
        <div className="content-wrapper">

            <div className="container content">
                <div className='card rounded-0'>
                    <div className="card-header">
                        <div className="card-title mb-0">
                            <span className="content-header">All Users</span>
                        </div>
                    </div>
                    <div className='card-body'>
                        <div className="table-responsive">
                            <table className="table table-bordered">
                                <thead>
                                    <tr>
                                        <th scope="col">ID</th>
                                        <th scope="col">User ID</th>
                                        <th scope="col">Username</th>
                                        <th scope="col">Package</th>
                                        <th scope="col">Expire on</th>
                                    </tr>
                                </thead>
                                <tbody>

                                    {data.map((currElem, index) => {

                                        const user = users.find(uid => uid.id === Number(currElem.user_id));

                                        return <tr key={index}>
                                            <td data-label="ID">{currElem.id}</td>
                                            <td data-label="User ID">{currElem.user_id}</td>
                                            <td data-label="Username">{user?.username || '-'} </td>
                                            <td data-label="Package">{currElem.package}</td>
                                            <td data-label="Expire on">{currElem.expires_on}</td>

                                        </tr>
                                    })}
                                </tbody>
                            </table>
                        </div>
                    </div>
                </div>
            </div>
        </div>

    )
}


export default Suscriber;
